const Fetchtoken=(username, password)=>{
    const send={username:username, password:password};
    const ob={};
    const api="http://localhost:5000/api/login";
    fetch(api,{
        method: 'POST',
        body:JSON.stringify(send),
        headers: new Headers({
            'Content-Type': 'application/json'
    })})
}

export default Fetchtoken;
